import React from 'react';

import './HomePage.scss';
import profPic from './../public/michaelProf.jpeg'

function HomePage() {
  return (
    <div id="PictureSection">
        <img src={profPic} alt="Michael Ferrara"></img>
    </div>
  );
}

export default HomePage;
